import './Form.css'
import React from 'react';

function Form(){
    return(
        <form>
            <div>
                <label>Name</label>
                <input placeholder='Name'></input>
                <br></br>
                <label>Genre</label>
                <input placeholder='Genre'></input>
                <br></br>
                <label>Studio</label>
                <input placeholder='Studio'></input>
            </div>
        </form>
    )
}


export default Form;
